INSERT INTO `v1_8e95e020377deb6e2d1030d959679079b57898c63601b66797c885bdc7f1188b` VALUES (11, 111011, 1110501043, 1, 1, 4, "", 1110501, 0, 0, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！");
INSERT INTO `v1_8e95e020377deb6e2d1030d959679079b57898c63601b66797c885bdc7f1188b` VALUES (91, 0, 1110501044, "", "", "", "", 1110501, "", "", "");
