INSERT INTO `v1_8e95e020377deb6e2d1030d959679079b57898c63601b66797c885bdc7f1188b` VALUES (11, 111011, 1110501046, 1, 1, 4, "", 1110501, 0, 0, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……");
INSERT INTO `v1_8e95e020377deb6e2d1030d959679079b57898c63601b66797c885bdc7f1188b` VALUES (91, 0, 1110501047, "", "", "", "", 1110501, "", "", "");
INSERT INTO `v1_8e95e020377deb6e2d1030d959679079b57898c63601b66797c885bdc7f1188b` VALUES (21, "vo_adv_1110501", 1110501048, 0, "", 0, "", 1110501, "", "", "vo_adv_1110501_003");
INSERT INTO `v1_8e95e020377deb6e2d1030d959679079b57898c63601b66797c885bdc7f1188b` VALUES (11, 111011, 1110501049, 1, 1, 5, "", 1110501, 0, 0, "ややっ？　よくよく見ればこの土台、\nケーキなのはほんの一部分だけで、\n大半はよく出来た模造品じゃあないか！\nな、なんと配慮の行き届いた……！");
